// Concerns.js

import React from 'react';
import './Concerns.css';

const Concerns = () => {
  return (
    <div className="concerns-page">
      <h2>Choose Your Concern</h2>
      <div className="concerns-grid">
        <div className="concern dryness">
          <h3>Dryness</h3>
          <p>Products for dry hair</p>
        </div>
        <div className="concern damage">
          <h3>Damage</h3>
          <p>Products for damaged hair</p>
        </div>
        <div className="concern frizz">
          <h3>Frizz</h3>
          <p>Products for frizzy hair</p>
        </div>
        <div className="concern curl-support">
          <h3>Curl Support</h3>
          <p>Products for curly hair</p>
        </div>
      </div>
      <button className="click-concerns-btn">CLICK FOR CONCERNS</button>
    </div>
  );
};

export default Concerns;
